import React from "react";

function Contact(){
    return(
        <div className="contactDiv">
            <p className="pageHeaders">Contact</p>
            <p>For enquires please email:</p>
            <h3>fhinn.mcclure@hotmail.com</h3>
        </div>
    );
}

export default Contact;
